import React from "react";
import Card from "./Card";

const CardList = ({ robots }) => {
    if (true) {
        throw new Error;
    }
    return (
        <div>
            { 
                robots.map((user, i) => {
                    return (
                        <Card 
                            key={i} 
                            id={user.id} 
                            name={user.name} 
                            email={user.email} 
                            username={user.username}
                        />
                    );
                })
            }
        </div>
    );
}

export default CardList
